import { NgModule } from '@angular/core';

import { SharedModule } from 'app/shared/shared.module';

import { PanelModule } from 'primeng/panel';
import { InputTextModule } from 'primeng/inputtext';
import { ButtonModule } from 'primeng/button';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { TabViewModule } from 'primeng/tabview';
import { TableModule } from 'primeng/table';
import { DialogModule } from 'primeng/dialog';
import { DropdownModule } from 'primeng/dropdown';
import { MultiSelectModule } from 'primeng/multiselect';
import { ChipsModule } from 'primeng/chips';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ConfirmationService, MessageService } from 'primeng/api';
import { InputNumberModule } from 'primeng/inputnumber';
import { OverlayPanelModule } from 'primeng/overlaypanel';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { DialogService, DynamicDialogModule } from 'primeng/dynamicdialog';
import { RippleModule } from 'primeng/ripple';
import { IcCodeService } from 'app/ng-connect';
import { InstalmentModule } from "app/payment/instalment/instalment.module";
import { MessagesModule } from 'primeng/messages';
import { MessageModule } from 'primeng/message';
import { FileUploadModule } from 'primeng/fileupload';
import { ProgressBarModule } from 'primeng/progressbar';
import { ToolbarModule } from 'primeng/toolbar';
import { ClaimRoutingModule } from './claim-routing.module';
import { ViewRemarksComponent } from './pop-up/view-remarks/view-remarks.component';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { CommonModule } from '@angular/common';
import {ViewPastClaimComponent} from "app/claim/pop-up/view-past-claim/view-past-claim.component";
import { ViewSupportingDocComponent } from './pop-up/view-supporting-doc/view-supporting-doc.component';
import { AccordionModule } from 'primeng/accordion';
import { FormlyMapService } from 'app/shared/service/formly-map.service';



@NgModule({
  imports: [
    CommonModule,
    SharedModule,
    PanelModule,
    InputTextModule,
    InputTextareaModule,
    InputNumberModule,
    ButtonModule,
    FormsModule,
    ReactiveFormsModule,
    TabViewModule,
    TableModule,
    DialogModule,
    DropdownModule,
    ChipsModule,
    MultiSelectModule,
    ConfirmPopupModule,
    OverlayPanelModule,
    RippleModule,
    MessageModule,
    MessagesModule,
    InstalmentModule,
    ToolbarModule,
    FileUploadModule,
    ProgressBarModule,
    ClaimRoutingModule,
    DynamicDialogModule,
    AccordionModule,
  ],
  declarations: [
    ViewRemarksComponent,
    ViewPastClaimComponent,
    ViewSupportingDocComponent,
    // ClaimLetterComponent,
    // CreateNewLetterComponent,
    // LetterItemComponent,
    // ChecklistItemComponent,
    // ClaimSuppDocComponent
  ],
  providers: [
    ConfirmationService,
    MessageService,
    NspConfirmationService,
    DialogService,
    IcCodeService,
    FormlyMapService
  ]
})
export class ClaimModule {
}
